from typing import List

def candidate(paren_string: str) -> List[str]:
    stack = []
    groups = []
    group = ''

    for char in paren_string.replace(' ', ''):
        if char == '(':
            stack.append(char)
            group += char
        elif char == ')':
            if stack:
                stack.pop()
                group += char
                if not stack:
                    groups.append(group)
                    group = ''
        else:
            continue

    return groups
